import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './dashboard.css'; // Import the CSS file
import UserHome from './userHome'; // Assuming you have a UserHome component to display user details

class Dashboard extends Component {
  render() {
    // Assuming `userData` is received as a prop from a parent component
    const { userData } = this.props;

    return (
      <div className="container">
        {/* Display the user's first name using userData */}
        <h1>Welcome to the Dashboard {userData.fname}!</h1>
        <div className="options">
          <Link to="/addCar">Add New Car</Link>
          <Link to="/changeOwner">Change Owner</Link>
          <Link to="/search">Search Cars</Link>
        </div>
      </div>
    );
  }
}

export default Dashboard;
